import { useState } from "react";
import VarTableRowData from "./var-table-row-data";
import Dropdown from "react-bootstrap/Dropdown";
import Chip from "./chip-list";
import { AnimatePresence, motion } from "motion/react";

function VariableModal({
  modalState,
  setModalState,
  incomingIndex,
  incomingValues,
  incomingHandleVariableChanges,
}) {
  function changeModalCondition() {
    console.log(`MODAL key :${incomingIndex}, values: ${incomingValues}`);
    console.log("Modal:", incomingIndex, incomingValues);
    setModalState(!modalState);
  }
  let tw_varModal_glassMorphBG =
    " bg-[color-mix(in_srgb,var(--main-color)_90%,transparent)] backdrop-blur-[10px]";
  // function printIntervalProperTerm() {
  //   switch (incomingValues.type) {
  //     case "Integer":
  //       return "Number";
  //     case "Date":
  //       return "Day(s)";
  //     default:
  //       return "";
  //   }
  // }

  function handleBackdropClick(event) {
    if (event.target === event.currentTarget) {
      setModalState(false);
    }
  }

  if (!incomingValues) {
    return null;
  }

  return (
    <>
      <AnimatePresence initial={false}>
        <motion.div>
          {modalState ? (
            <>
              <div className="w-screen h-screen inset-0 fixed z-[100]">
                <div
                  className="w-screen h-screen inset-0 fixed bg-[rgba(49,49,49,0.8)]"
                  onClick={handleBackdropClick}
                >
                  <div
                    className={`w-[80%] text-center absolute h[50vh] grid gap-[10px] -translate-x-2/4 -translate-y-2/4 leading-[1.4] max-w-[70%] min-w-[300px] px-7 py-3.5 rounded-[3px] left-2/4 top-2/4 ${tw_varModal_glassMorphBG} border border-white`}
                  >
                    <div>
                      <h1>
                        <VarTableRowData
                          incomingKey={incomingIndex}
                          incomingValues={incomingValues}
                          tableDataType={"VarName"}
                          incomingchangedValues={"name"}
                          incomingHandleVariableChanges={
                            incomingHandleVariableChanges
                          }
                          incomingCustomColorText={"opposite-color"}
                        ></VarTableRowData>
                      </h1>
                      <div className="w-full ">
                        <div
                          className={`w-full [$>*]:w-full grid place-items-center ${
                            incomingValues.type !== "String"
                              ? "grid-rows-3"
                              : "grid-rows-2"
                          },0.5fr)] gap-[10px] auto-rows-auto`}
                        >
                          <div
                            className={`w-full gap-[2%] h-auto [&>*]:w-full [&>*]:text-sm [&>*]:w-full grid place-items-center ${
                              incomingValues.type !== "String"
                                ? "grid-cols-3"
                                : "grid-cols-1"
                            } `}
                          >
                            <div className="w-full h-full">
                              <Dropdown>
                                <Dropdown.Toggle
                                  variant="secondary"
                                  id="dropdown-basic"
                                  style={{
                                    minWidth: "auto",
                                    width: "100%",
                                  }}
                                  className="!w-full"
                                >
                                  {incomingValues.type}
                                </Dropdown.Toggle>

                                <Dropdown.Menu className="!z-index-1">
                                  <Dropdown.Item
                                    onClick={() =>
                                      incomingHandleVariableChanges(
                                        incomingIndex,
                                        "type",
                                        "Integer"
                                      )
                                    }
                                  >
                                    Integer
                                  </Dropdown.Item>
                                  <Dropdown.Item
                                    onClick={() =>
                                      incomingHandleVariableChanges(
                                        incomingIndex,
                                        "type",
                                        "String"
                                      )
                                    }
                                  >
                                    String
                                  </Dropdown.Item>
                                  <Dropdown.Item
                                    onClick={() =>
                                      incomingHandleVariableChanges(
                                        incomingIndex,
                                        "type",
                                        "Date"
                                      )
                                    }
                                  >
                                    Date
                                  </Dropdown.Item>
                                  <Dropdown.Item
                                    onClick={() =>
                                      incomingHandleVariableChanges(
                                        incomingIndex,
                                        "type",
                                        "List"
                                      )
                                    }
                                  >
                                    List
                                  </Dropdown.Item>
                                </Dropdown.Menu>
                              </Dropdown>
                            </div>

                            {incomingValues.type != "String" ? (
                              <>
                                <div className="w-full h-full">
                                  <div>Randomize</div>

                                  <VarTableRowData
                                    incomingKey={incomingIndex}
                                    incomingValues={incomingValues}
                                    tableDataType={"VarBoolean"}
                                    incomingchangedValues={"randomize"}
                                    incomingHandleVariableChanges={
                                      incomingHandleVariableChanges
                                    }
                                  ></VarTableRowData>
                                </div>
                                <div className="w-full h-full ">
                                  <div>Iterate</div>
                                  <VarTableRowData
                                    incomingKey={incomingIndex}
                                    incomingValues={incomingValues}
                                    tableDataType={"VarBoolean"}
                                    incomingchangedValues={"iterate"}
                                    incomingHandleVariableChanges={
                                      incomingHandleVariableChanges
                                    }
                                  ></VarTableRowData>
                                </div>
                              </>
                            ) : null}
                          </div>

                          {incomingValues.type == "List" ? (
                            <div className="w-full border  ">
                              Chip List
                              <div className="w-full grid grid-cols-3 gap-[10px]">
                                <Chip
                                  incomingVariableIndex={incomingIndex}
                                  incomingChipList={incomingValues.list}
                                  incomingHandleVariableChanges={
                                    incomingHandleVariableChanges
                                  }
                                ></Chip>
                              </div>
                            </div>
                          ) : null}
                          <div
                            className={`gap-[10px] border  w-full [&>*]:w-full grid place-items-center ${
                              incomingValues.type !== "String" &&
                              incomingValues.type !== "List" &&
                              incomingValues.randomize
                                ? "grid-cols-2"
                                : "grid-cols-1"
                            }`}
                          >
                            {incomingValues.type == "Integer" ||
                            incomingValues.type == "String" ||
                            incomingValues.type == "List" ? (
                              <>
                                {!incomingValues.randomize ? (
                                  <div className="w-full ">
                                    Start Value
                                    <VarTableRowData
                                      incomingKey={incomingIndex}
                                      incomingValues={incomingValues}
                                      tableDataType={"VarStartValue"}
                                      incomingchangedValues={"value"}
                                      incomingHandleVariableChanges={
                                        incomingHandleVariableChanges
                                      }
                                      incomingCustomColorText={"opposite-color"}
                                      incomingCustomBGColorText={"white"}
                                    ></VarTableRowData>
                                  </div>
                                ) : (
                                  <>
                                    {incomingValues.type == "List" ? (
                                      <div className="w-full ">
                                        Start Value
                                        <VarTableRowData
                                          incomingKey={incomingIndex}
                                          incomingValues={incomingValues}
                                          tableDataType={"VarStartValue"}
                                          incomingchangedValues={"value"}
                                          incomingHandleVariableChanges={
                                            incomingHandleVariableChanges
                                          }
                                          incomingCustomColorText={
                                            "opposite-color"
                                          }
                                          incomingCustomBGColorText={"white"}
                                        ></VarTableRowData>
                                      </div>
                                    ) : null}
                                  </>
                                )}
                                {incomingValues.randomize &&
                                !incomingValues.type !== "String" &&
                                incomingValues.type !== "List" ? (
                                  <>
                                    <div>
                                      Min Value
                                      <VarTableRowData
                                        incomingKey={incomingIndex}
                                        incomingValues={incomingValues}
                                        tableDataType={"VarStartValue"}
                                        incomingchangedValues={"minValue"}
                                        incomingHandleVariableChanges={
                                          incomingHandleVariableChanges
                                        }
                                        incomingCustomColorText={
                                          "opposite-color"
                                        }
                                        incomingCustomBGColorText={"white"}
                                      ></VarTableRowData>
                                    </div>

                                    <div>
                                      Max Value
                                      <VarTableRowData
                                        incomingKey={incomingIndex}
                                        incomingValues={incomingValues}
                                        tableDataType={"VarStartValue"}
                                        incomingchangedValues={"maxValue"}
                                        incomingHandleVariableChanges={
                                          incomingHandleVariableChanges
                                        }
                                        incomingCustomColorText={
                                          "opposite-color"
                                        }
                                        incomingCustomBGColorText={"white"}
                                      ></VarTableRowData>
                                    </div>
                                  </>
                                ) : null}
                              </>
                            ) : null}

                            {incomingValues.type == "Date" ? (
                              <>
                                {!incomingValues.randomize ? (
                                  <div>
                                    Start Date Value
                                    <VarTableRowData
                                      incomingKey={incomingIndex}
                                      incomingValues={incomingValues}
                                      tableDataType={"VarStartValue"}
                                      incomingchangedValues={"dateValue"}
                                      incomingHandleVariableChanges={
                                        incomingHandleVariableChanges
                                      }
                                      incomingCustomColorText={"opposite-color"}
                                      incomingCustomBGColorText={"white"}
                                    ></VarTableRowData>
                                  </div>
                                ) : null}
                                {incomingValues.randomize ? (
                                  <>
                                    <div>
                                      Min Date Value
                                      <VarTableRowData
                                        incomingKey={incomingIndex}
                                        incomingValues={incomingValues}
                                        tableDataType={"VarStartValue"}
                                        incomingchangedValues={"minDateValue"}
                                        incomingHandleVariableChanges={
                                          incomingHandleVariableChanges
                                        }
                                        incomingCustomColorText={
                                          "opposite-color"
                                        }
                                        incomingCustomBGColorText={"white"}
                                      ></VarTableRowData>
                                    </div>
                                    <div>
                                      Max Date Value
                                      <VarTableRowData
                                        incomingKey={incomingIndex}
                                        incomingValues={incomingValues}
                                        tableDataType={"VarStartValue"}
                                        incomingchangedValues={"maxDateValue"}
                                        incomingHandleVariableChanges={
                                          incomingHandleVariableChanges
                                        }
                                        incomingCustomColorText={
                                          "opposite-color"
                                        }
                                        incomingCustomBGColorText={"white"}
                                      ></VarTableRowData>
                                    </div>
                                  </>
                                ) : null}
                              </>
                            ) : null}
                          </div>
                          {incomingValues.iterate ? (
                            <div className="w-full border ">
                              Interval
                              <VarTableRowData
                                incomingKey={incomingIndex}
                                incomingValues={incomingValues}
                                tableDataType={"VarInterval"}
                                incomingchangedValues={"interval"}
                                incomingHandleVariableChanges={
                                  incomingHandleVariableChanges
                                }
                                incomingCustomColorText={"opposite-color"}
                                incomingCustomBGColorText={"white"}
                              ></VarTableRowData>
                            </div>
                          ) : null}
                        </div>
                      </div>
                    </div>
                    <div>
                      <button
                        onClick={(e) => changeModalCondition()}
                        className="bg-opposite-color text-main-color border-2 border-main-color p-[10px] hover:bg-main-color hover:border-opposite-color hover:text-opposite-color rounded-[10px]"
                      >
                        Close Variable
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            </>
          ) : null}
        </motion.div>
      </AnimatePresence>
    </>
  );
}

export default VariableModal;
